INSERT INTO `notizie_serie` (`g_id`, `g_team`, `g_serie`, `g_data`, `g_titolo`, `g_testo`) VALUES
(0, 'jammins', '3.1', '2010-02-24', 'BENVENUTI !!', 'Un caloroso benvenuto a tutti gli iscritti. Potete usare questo guestbook per lasciare un commento o comunicare con gli altri utenti di GoalUnited Analysis.'),
(1, 'Siac Messina', '3.1', '2010-04-12', 'Mamuthebest', 'ciao a tutti!!!'),
(2, 'jammins', '3.1', '2010-04-15', 'NUOVA SEZIONE ALLENAMENTO', 'Ciao ragazzi. Provate la nuova sezione allenamento. Inserendo i dati precisi sulle tattiche vedrete gli effetti nel calcolatore Formazioni!!!'),
(3, '11 pagliacci', '3.1', '2010-04-22', 'Consiglio', 'Ciao ragazzi qualcuno mi pu√≤ dare un consiglio per migliorare la forma dei miei 11 pagliacci?\r\n\r\nSaluti. Pasquale\r\n\r\n11 pagliacci\r\nSerie 6.968'),
(4, 'jammins', '3.1', '2010-04-23', 'Forma giocatori', 'ciao pasquale, lunico modo di migliorare la forma √® quello di allenarla, come anche la condizione. Soltanto la freschezza dipende dal fisioterapista che deve avere abilit√† maggiore di 50 per recuperarla velocemente'),
(5, '11 pagliacci', '3.1', '2010-04-26', 'Quando ricomincia?', 'Qualcuno sa quando ricomincia la nuova stagione?\r\n\r\nP.S. grazie sexjam per il consiglio!!\r\n\r\nCiao. Pasquale'),
(6, 'jammins', '3.1', '2010-05-07', 'Nuova stagione', 'Sabato 8 maggio inizia la nuova stagione. Buon goalunited a tutti !!!!!'),
(7, 'alemacusVFC', '3.1', '2010-05-18', 'ciao', 'ciao'),
(8, 'Pessegatto', '3.1', '2010-05-19', 'Bug risolti', 'Hai sistemato il calcolatore della formazione e pure il calcolo della forza della rosa. Bravissimo, continua cos√¨ ! ;-)'),
(9, 'Gigghis FC', '3.1', '2010-05-20', 'Gigghis', 'Ciao a tutti'),
(10, 'Gigghis FC', '3.1', '2010-05-20', 'Problema', 'Non mi carica i giocatori con talento calci angolo... da errore. help me?\r\nPS: come si cancellano i giocatori inseriti male in cui non viene visualizzato il nome?'),
(11, '11 pagliacci', '3.1', '2010-05-21', 'Gigghis', 'oltre a mettere il talento inserisci anche il livello...(1,2,3..ecc.)?\r\n\r\nPer cancellare un giocatore basta selezionare il nome del giocatore, entra nella sua scheda ed in fondo premere elimina o resetta, scegli tu cosa fare.\r\n\r\nCiao'),
(12, 'jammins', '3.1', '2010-05-22', 'per Gigghis', 'Come dice Pasquale per cancellare un giocatore seleziona il suo nome e poi premi il tasto elimina. Invece il tasto resetta non fa altro che riportare i valori del giocatore al loro valore prima di una eventuale modifica. '),
(13, 'jammins', '3.1', '2010-05-22', 'altro bug corretto', 'Sempre dietro vostro suggerimento ho corretto il bug che non faceva inviare i messaggi sul guestbook. in realt√† non accettava caratteri come l''apice o i doppi apici.. '),
(14, '11 pagliacci', '3.1', '2010-05-26', 'segnalazione', 'Attivando il Premium su GU, ho notato che: le posizioni nei quadranti consigliate dal tuo sito, non corrispondono con le posizioni ideali consigliate dal sito GU. \r\nSaluti a tutti. Pasquale'),
(15, '11 pagliacci', '3.1', '2010-05-27', 'segnalazione 2', 'Nella sezione formazione non √© possibile inserire i giocatori nelle subposition.'),
(16, 'jammins', '3.1', '2010-05-27', 'segnalazione 2', '√® un problema di internet explorer. con firefox, chrome safar e opera funziona... prover√≤ cmq a fare qualcosa al riguardo. ciao'),
(17, '11 pagliacci', '3.1', '2010-05-28', 'Sezione giocatori', 'Non si riesce a salvare o modificare i giocatori. Sempre colpa di Internet Explorer o altro?\r\nCiao. Pasquale'),
(18, 'jammins', '3.1', '2010-05-29', 'salvataggio', 'sto provando dal cellulare e non ho avuto alcun problema a salvare i giocatori. A te esce un messaggio di errore?'),
(19, '11 pagliacci', '3.1', '2010-05-29', 'A me esce questo...', 'Errore nella query GIOCATORI: You have an error in your SQL syntax; check the manual that corresponds to your MySQL server version for the right syntax to use..ecc...il resto (formazione) adesso funziona perfettamente, hai risolto alla grande!'),
(20, 'jammins', '3.1', '2010-05-29', 'errore nella sezione giocatori', 'ciao pasquale, credo che l''errore che ti capita dipende dal fatto che il nome di un tuo giocatore contiene un''apice o una virgoletta singola o doppia. Purtroppo dovrai attendere qualche giorno, perch√© al momento sono fuori per un po'' . Fammi sapere se √® questo il problema. Ciao'),
