(22, 'giumpaofc', '3.1', '2010-05-31', 'Saluti', 'Un saluto a tutta la comunit√†.\r\nBuon GU a tutti.'),
(23, 'giumpaofc', '3.1', '2010-06-01', 'errore nella sezione giocatori', 'Salve, ho notato che inserendo il file csv importato da GU, nella skill riguardante l''esperienza dei singoli giocatori viene riportato il valore numerico della maglia anzich√® l''effettiva esperienza maturata del giocatore, ci√≤ influisce nella valutazione di goalunited analysis oppure √® un fattore trascurabile??'),
