(26, 'giumpaofc', '3.1', '2010-06-02', 'VFC sucamela', 'sei sempre il solito rikkioncello, non ti fidi mai :)'),
(27, 'StradaroliVFC', '3.1', '2010-06-03', '&quot;Import Giocatori&quot;', 'Ho provveduto a correggere gli errori nella sezione &quot;importa Giocatori&quot; Adesso viene caricato il valore corretto dell''esperienza e non pi√π quello del numero di maglia.\r\nInoltre ho corretto anche il bug che non permetteva di inserire l''apostrofo nel nome del giocatore.\r\n\r\nFatemi sapere se √® tutto ok, o se c''√® qualcos''altro che non va.\r\nSaluti a tutti.'),
(28, 'StradaroliVFC', '3.1', '2010-06-03', 'x Gigghis', 'Ho corretto l''errore che non dava Calci d''angolo nei giocatori. Puoi verificare se √® tutto ok?\r\nCiao.'),
(29, 'Gli Illuminati', '3.1', '2010-06-04', 'Simulazione', 'Ciao a tutti per caso c''√® un modo o un programma per fare una simulazione tra due squadre in modo tale da vedere chi ha pi√π possibilit√† di vittoria? grazie mille '),
(30, 'jammins', '3.1', '2010-06-09', 'simulazione', 'Che io sappia non esiste un programma  del genere. Per√≤ se vi fa piacere avevo gi√† in mente qualcosa di simile... potremmo organizzare partite tra di noi...'),
(31, 'Mc Piece', '3.1', '2010-06-13', 'Errori', 'Ciao.\r\nA me c√® il problema che appena modifico la skill di un giocatore, devo obbligatoriamente portare stipendio,valore mercato ecc a ZERO, non so ora se capita solo a me...\r\nSecondo voi come si puo risolvere questo problema?'),
