(33, 'Gli Illuminati', '3.1', '2010-06-14', 'Simulazione', 'Ciao Sexjam io sono d''accordo per organizzare delle partite tra di noi:) dimmi pure quando c''√® un evento che ci sar√≤ :)'),
(34, '11 pagliacci', '3.1', '2010-06-14', 'giocatori desaparecidos', 'Ciao sexjam, ho un problema. Mentre aggiornavo le skill dei giocatori sono stato disconnesso e rientrando nel sito mi sono scomparsi 2 giocatori. il n¬∞ 13 ed il n¬∞ 20. Ho cercato di inserire i dati come se fossero due nuovi giocatori ma esce una finestra nel quale mi si dice &quot;il numero del giocatore √© gi√† esistente&quot; o qualcosa di simile. Tu puoi fare qualcosa? Te ne sarei grato.'),
(35, 'porchetts', '3.1', '2010-06-14', 'file csv', 'Ciao, complimenti per il programma.\r\n\r\nVolevo sapere se ci fosse la possibilit√† di inserire un convertitore per generare il file .csv quando creiamo la nostra rosa, in modo da avere anche in caso di cancellazione di uno o pi√π giocatori la possibilit√† di ricaricare tutto senza perdere i dati immessi.\r\n\r\nInoltre, non so se sia possibile, ma quando inseriamo un giocatore nel calcolatore di posizione si potrebbe conoscere la forza precisa del giocatore? (questo per sapere ad esempio in anticipo la forza di un primavera)'),
(36, '11 pagliacci', '3.1', '2010-06-15', 'ottimo consiglio', 'Sono d''accordo con Spino. Sarebbe molto utile conoscere la forza di un giocatore in una precisa posizione.'),
(37, 'Pessegatto', '3.1', '2010-06-15', 'Statistiche Staff', 'Ciao, le statistiche relative allo staff risultano ordinate in base al giorno del mese anzich√® alla data completa come invece potrebbe essere pi√π utile. Si pu√≤ sistemare ? Grazie ! '),
