INSERT INTO `z_telecronaca` (`id_partita`, `data`, `prog`, `min`, `descri`) VALUES
(0, '2010-11-11', 23, 73, 'Azione pericolosa di <font color=''#FF0000''><b>Ichas<font color=''#FFFFFF''></b> sulla fascia sinistra<br>cross insidioso di <font color=''#FF0000''><b>Ichas<font color=''#FFFFFF''></b> <br>ma <font color=''#0099FF''><b>Melik Isgoren<font color=''#FFFFFF''></b> si immola in scivolata e respinge il pallone.'),
(0, '2010-11-11', 22, 72, 'Calcio d''angolo per  <font color=''#0099FF''><b>Gli Illuminati<font color=''#FFFFFF''></b><br>si incarica della battuta <font color=''#0099FF''><b>Gianpietro Malesani<font color=''#FFFFFF''></b><br>pallone calciato con molto effetto in mezzo all''area<br><font color=''#0099FF''><b>Serdar Sancaktutan<font color=''#FFFFFF''></b> stoppa la palla con il petto'),
(0, '2010-11-11', 21, 58, 'Bel passaggio per <font color=''#0099FF''><b>Gianpietro Malesani<font color=''#FFFFFF''></b> sulla fascia sinistra<br><font color=''#0099FF''><b>Gianpietro Malesani<font color=''#FFFFFF''></b> stoppa magistralmente il pallone ed avanza portandosi in buona posizione<br>dribbla due avversari e crossa al centro<br>dal limite dell''area arriva in corsa <font color=''#0099FF''><b>Ilke Selvili<font color=''#FFFFFF''></b><br>che batte in rete a colpo sicuro<br>ma <font color=''#FF0000''><b>Pastor<font color=''#FFFFFF''></b> si getta in tuffo e salva sulla linea!'),
(0, '2010-11-11', 17, 45, 'Il duplice fischio dell''arbitro sancisce la fine del primo tempo.'),
(0, '2010-11-11', 18, 46, 'La squadra di casa batte il calcio di inizio del secondo tempo.'),
(0, '2010-11-11', 19, 51, 'I difensori di <font color=''#0099FF''><b>Gli Illuminati<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola √® scattata! Fuorigioco netto!'),
(0, '2010-11-11', 20, 57, '<font color=''#0099FF''><b>Melik Isgoren<font color=''#FFFFFF''></b> interviene in ritardo ed invece che prendere il pallone colpisce in pieno la gamba dell''avversario.<br>L''arbitro corre verso <font color=''#0099FF''><b>Melik Isgoren<font color=''#FFFFFF''></b> e lo ammonisce.<br><br>Calcio di punizione da circa 30 metri per <font color=''#FF0000''><b>porchetts<font color=''#FFFFFF''></b><br>il braccio alzato dell''arbitro indica che √® di seconda<br><font color=''#FF0000''><b>Meydanli<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#FF0000''><b>Marizani<font color=''#FFFFFF''></b> prova a piazzare il pallone sul palo coperto dalla barriera'),
(0, '2010-11-11', 16, 41, '<font color=''#FF0000''><b>Meydanli<font color=''#FFFFFF''></b>  avanza con la palla a centrocampo.<br><font color=''#FF0000''><b>Meydanli<font color=''#FFFFFF''></b>  prova lo scambio con <font color=''#FF0000''><b>Marizani<font color=''#FFFFFF''></b>.<br><font color=''#FF0000''><b>Marizani<font color=''#FFFFFF''></b> riceve il pallone e lo stoppa con eleganza<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br>√® incredibile cosa sia riuscito a sbagliare!'),
(0, '2010-11-11', 15, 39, 'Pallone stoppato magistralmente in area di rigore da <font color=''#0099FF''><b>Julio Santolaria<font color=''#FFFFFF''></b><br>si √® guadagnato un piccolo spazio tra le maglie della difesa<br>prova il tiro<br>e segna con un tiro ben piazzato! GOAL per  <font color=''#0099FF''><b>Gli Illuminati<font color=''#FFFFFF''></b>.'),
(0, '2010-11-11', 14, 37, '<font color=''#FF0000''><b>Rodrega<font color=''#FFFFFF''></b> avanza con la palla a centrocampo<br>sembra voler tentare un passaggio filtrante per premiare lo scatto del compagno<br>ma la difesa √® ben piazzata e chiude tutti gli spazi<br>prova a liberarsi del suo marcatore'),
(0, '2010-11-11', 13, 35, 'Bell''iniziativa di <font color=''#0099FF''><b>Gianpietro Malesani<font color=''#FFFFFF''></b> fascia sinistra<br><font color=''#0099FF''><b>Gianpietro Malesani<font color=''#FFFFFF''></b> arriva sul fondo e crossa al centro<br>il pallone arriva nella zona di <font color=''#0099FF''><b>Ilke Selvili<font color=''#FFFFFF''></b> e prova subito il tiro<br>ma svirgola il pallone e l''azione sfuma.'),
(0, '2010-11-11', 11, 19, 'Azione pericolosa di <font color=''#FF0000''><b>Meydanli<font color=''#FFFFFF''></b> sulla fascia sinistra <br>punta <font color=''#0099FF''><b>Rafet Sozbilir<font color=''#FFFFFF''></b> e lo supera senza problemi<br>dribbla un paio di avversari con un doppio passo<br>cerca di trovare lo spazio giusto per tirare'),
(0, '2010-11-11', 12, 30, 'Intervento piuttosto ruvido di <font color=''#0099FF''><b>Melik Isgoren<font color=''#FFFFFF''></b> ai limiti del regolamento e l''arbitro fischia il fallo.<br><br>Calcio di punizione per <font color=''#FF0000''><b>porchetts<font color=''#FFFFFF''></b> in posizione leggermente defilata sulla sinistra<br>siamo a circa 19 metri dalla porta<br>la punizione √® di prima<br>lunga rincorsa di <font color=''#FF0000''><b>Meydanli<font color=''#FFFFFF''></b><br>d√† un ultimo sguardo al portiere e tira'),
(0, '2010-11-11', 10, 19, 'Azione pericolosa di <font color=''#FF0000''><b>Ichas<font color=''#FFFFFF''></b> sulla fascia sinistra <br>punta <font color=''#0099FF''><b>Melik Isgoren<font color=''#FFFFFF''></b> e lo supera senza problemi<br>dribbla un paio di avversari con un doppio passo<br>cerca di trovare lo spazio giusto per tirare'),
(0, '2010-11-11', 6, 11, 'Rigore per <font color=''#FF0000''><b>porchetts<font color=''#FFFFFF''></b><br><font color=''#FF0000''><b>Ichas<font color=''#FFFFFF''></b> si avvia verso il dischetto senza esitazioni<br>sistema con cura la palla, aspetta il fischio dell''arbitro e dopo una breve rincorsa calcia di collo pieno'),
(0, '2010-11-11', 7, 13, 'I difensori di <font color=''#0099FF''><b>Gli Illuminati<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola √® scattata! Fuorigioco netto!'),
(0, '2010-11-11', 8, 16, 'I difensori di <font color=''#FF0000''><b>porchetts<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola √® scattata! Fuorigioco netto!'),
(0, '2010-11-11', 9, 16, 'Calcio d''angolo per <font color=''#0099FF''><b>Gli Illuminati<font color=''#FFFFFF''></b><br><font color=''#0099FF''><b>Gianpietro Malesani<font color=''#FFFFFF''></b> √® pronto per la battuta<br>il calcio d''angolo spiove in area all''altezza del dischetto del rigore<br>mischia in area di rigore, <font color=''#0099FF''><b>Ilke Selvili<font color=''#FFFFFF''></b> e <font color=''#FF0000''><b>Rodrega<font color=''#FFFFFF''></b> saltano insieme'),
(0, '2010-11-11', 28, 68, 'Pallone conquistato in area di rigore da <font color=''#FF0000''><b>Alessio Ronzoni<font color=''#FFFFFF''></b><br>evita il disperato intervento in scivolata del difensore centrale<br> calcia in porta di collo pieno, <br>ma √® pressato da <font color=''#0099FF''><b>Polat Hamdiakan<font color=''#FFFFFF''></b> e perde il controllo del pallone.'),
(0, '2010-11-11', 27, 62, '<font color=''#FF0000''><b>Alessio Ronzoni<font color=''#FFFFFF''></b> interviene in ritardo ed invece che prendere il pallone colpisce in pieno la gamba dell''avversario.<br>L''arbitro corre verso <font color=''#FF0000''><b>Alessio Ronzoni<font color=''#FFFFFF''></b> e lo ammonisce.<br><br>Calcio di punizione da circa 30 metri per <font color=''#0099FF''><b>Mc Piece<font color=''#FFFFFF''></b><br>il braccio alzato dell''arbitro indica che √® di seconda<br><font color=''#0099FF''><b>Roldan Ventura<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#0099FF''><b>Jaime Pablo<font color=''#FFFFFF''></b> prova a piazzare il pallone sul palo coperto dalla barriera<br>e con un tiro potentissimo quasi sfonda la rete! GOAL per <font color=''#0099FF''><b>Mc Piece<font color=''#FFFFFF''></b>!!!'),
(0, '2010-11-11', 25, 56, 'Pallone stoppato magistralmente in area di rigore da <font color=''#0099FF''><b>Kagan Cik<font color=''#FFFFFF''></b><br>si √® guadagnato un piccolo spazio tra le maglie della difesa<br>prova il tiro<br>palo interno e gol! GOAL per <font color=''#0099FF''><b>Mc Piece<font color=''#FFFFFF''></b>.'),
(0, '2010-11-11', 26, 57, '<font color=''#FF0000''><b>Beato Zimbardo<font color=''#FFFFFF''></b> riceve palla sulla sua fascia di competenza<br>corre lungo la fascia laterale<br>effettua un passaggio a <font color=''#FF0000''><b>Manuel Buffetti<font color=''#FFFFFF''></b><br>con uno stop perfetto si √® portato in ottima posizione<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br>ma <font color=''#0099FF''><b>Pit Helwig<font color=''#FFFFFF''></b> con un riflesso incredibile riesce a respingere il pallone.'),
(0, '2010-11-11', 0, 0, 'Un caloroso saluto a tutti voi. Siamo oggi in diretta per commentare l''amichevole tra <font color=''#0099FF''><b>prezzatese</b></font><font color=''#FFFFFF''> e <font color=''#FF0000''><b>alemacusVFC</b></font><font color=''#FFFFFF''>. Abbiamo appena ricevuto le formazioni: l''allenatore del <font color=''#0099FF''><b>prezzatese</b></font><font color=''#FFFFFF''> ha deciso di schierare la sua squadra con un <b>3 4 3</b>, <font color=''#FF0000''><b>alemacusVFC</b></font><font color=''#FFFFFF''> scende in campo con il <b>4 4 2</b>.'),
(0, '2010-11-11', 24, 51, 'Pallone conquistato in area di rigore da <font color=''#FF0000''><b>Beato Zimbardo<font color=''#FFFFFF''></b><br>passaggio di <font color=''#FF0000''><b>Beato Zimbardo<font color=''#FFFFFF''></b> verso <font color=''#FF0000''><b>C√©dric Geurts<font color=''#FFFFFF''></b><br>ha seguito bene l''azione ed ora √® in ottima posizione<br>cerca di trovare lo spazio giusto per tirare<br>ma <font color=''#0099FF''><b>Paker Atmaca<font color=''#FFFFFF''></b> libera con un colpo di testa.'),
