(0, '2010-11-11', 31, 90, '<br><br><b>RIEPILOGO PARTITA</b><br>La percentuale di azioni della squadra <font color=''#0099FF''><b>Pessegatto</b><font color=''#FFFFFF''> √® stata: 80%, mentre quella della squadra <font color=''#FF0000''><b>FC Real Cardi</b><font color=''#FFFFFF''> √® stata: 20%.'),
