(0, '2010-11-11', 25, 66, '<font color=''#FF0000''><b>A.Adamo<font color=''#FFFFFF''></b> stoppa la palla in area di rigore<br>con uno sguardo controlla la posizione dei suoi compagni di squadra<br>prova un difficile passaggio filtrante per <font color=''#FF0000''><b>B.Stella<font color=''#FFFFFF''></b><br>che stoppa la palla in buona posizione davanti alla porta<br>cerca di trovare lo spazio giusto per tirare<br>√® pressato, per√≤ riesce a mantenere il controllo del pallone<br><font color=''#0099FF''><b>Sayin<font color=''#FFFFFF''></b> si allunga il pi√π possibile, ma riesce solo a sfiorare il pallone.<br>GOAL per <font color=''#FF0000''><b>FC Real Cardi<font color=''#FFFFFF''></b>.'),
