(0, '2010-11-11', 14, 34, '<font color=''#0099FF''><b>Morgas<font color=''#FFFFFF''></b> si guadagna la palla a centrocampo<br>non trova nessun compagno libero e prova ad avanzare da solo con un bellissimo gioco di gambe supera due avversari<br>si apre un varco e passa la palla a <font color=''#0099FF''><b>Mikielczyk<font color=''#FFFFFF''></b> che √® libero<br>il gioco √© in mano, o meglio nei piedi di <font color=''#0099FF''><b>Mikielczyk<font color=''#FFFFFF''></b><br>ha il tempo di mirare e prova il tiro<br>ma la porta di <font color=''#FF0000''><b>A.Akdag<font color=''#FFFFFF''></b> non corre nessun pericolo.'),
