(0, '2010-11-11', 13, 34, '<font color=''#0099FF''><b>Morgas<font color=''#FFFFFF''></b> avanza con la palla a centrocampo<br>sembra voler tentare un passaggio filtrante per premiare lo scatto del compagno<br>ma la difesa √® ben piazzata e chiude tutti gli spazi<br>prova a liberarsi del suo marcatore<br>ma il tiro √® troppo debole per impensierire <font color=''#FF0000''><b>A.Akdag<font color=''#FFFFFF''></b>.'),
(0, '2010-11-11', 23, 51, '<font color=''#FF0000''><b>Alessio Ronzoni<font color=''#FFFFFF''></b>  avanza con la palla a centrocampo.<br><font color=''#FF0000''><b>Alessio Ronzoni<font color=''#FFFFFF''></b>  prova lo scambio con <font color=''#FF0000''><b>Manuel Buffetti<font color=''#FFFFFF''></b>.<br><font color=''#FF0000''><b>Manuel Buffetti<font color=''#FFFFFF''></b> riceve il pallone e lo stoppa con eleganza<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br>ma alla fine non riesce a segnare pur essendo vicinissimo alla porta!'),
