(0, '2010-11-11', 20, 40, 'Calcio d''angolo per  <font color=''#FF0000''><b>Silica<font color=''#FFFFFF''></b><br><font color=''#FF0000''><b>Alessio Ronzoni<font color=''#FFFFFF''></b> √® pronto a battere<br>palla lunga sul secondo palo<br><font color=''#FF0000''><b>C√©dric Geurts<font color=''#FFFFFF''></b> e <font color=''#0099FF''><b>Carisio Piras<font color=''#FFFFFF''></b> si lanciano insieme sul pallone<br><font color=''#FF0000''><b>C√©dric Geurts<font color=''#FFFFFF''></b> aiutandosi con le braccia riesce a tenere a distanza l''avversario<br>prova a calciare, ma svirgola malamente e manca la porta!'),
(0, '2010-11-11', 19, 39, '<font color=''#FF0000''><b>Alessio Ronzoni<font color=''#FFFFFF''></b> avanza con la palla a centrocampo<br>sembra voler tentare un passaggio filtrante per premiare lo scatto del compagno<br>ma la difesa √® ben piazzata e chiude tutti gli spazi<br>prova a liberarsi del suo marcatore<br>ma i giocatori non si sono capiti ed hanno sbagliato i movimenti'),
(0, '2010-11-11', 18, 37, '<font color=''#FF0000''><b>Alessio Ronzoni<font color=''#FFFFFF''></b> avanza con la palla a centrocampo<br>sembra voler tentare un passaggio filtrante per premiare lo scatto del compagno<br>ma la difesa √® ben piazzata e chiude tutti gli spazi<br>prova a liberarsi del suo marcatore<br>ma <font color=''#0099FF''><b>Mauregato Talavera<font color=''#FFFFFF''></b> si immola in scivolata e respinge il pallone.'),
