(0, '2010-11-11', 26, 40, 'Calcio d''angolo per  <font color=''#FF0000''><b>11 pagliacci<font color=''#FFFFFF''></b><br><font color=''#FF0000''><b>Valentin LEIBIGER<font color=''#FFFFFF''></b> √® pronto a battere<br>palla lunga sul secondo palo<br><font color=''#FF0000''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> e <font color=''#0099FF''><b>Micha? Kulbinska<font color=''#FFFFFF''></b> si lanciano insieme sul pallone<br><font color=''#FF0000''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> aiutandosi con le braccia riesce a tenere a distanza l''avversario<br>fuori di poco, pochi centimetri e sarebbe entrata!'),
