(0, '2010-11-11', 19, 44, '<font color=''#FF0000''><b>Pelaez<font color=''#FFFFFF''></b> interviene in ritardo ed invece che prendere il pallone colpisce in pieno la gamba dell''avversario.<br>L''arbitro corre verso <font color=''#FF0000''><b>Pelaez<font color=''#FFFFFF''></b> e lo ammonisce.<br><br>Calcio di punizione da circa 30 metri per <font color=''#0099FF''><b>11 pagliacci<font color=''#FFFFFF''></b><br>il braccio alzato dell''arbitro indica che √® di seconda<br><font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#0099FF''><b>Vicenz PORCEL<font color=''#FFFFFF''></b> prova a piazzare il pallone sul palo coperto dalla barriera<br>ma il portiere √® in posizione perfetta e non lascia passare la sfera.'),
(0, '2010-11-11', 16, 41, 'Bell''iniziativa di <font color=''#FF0000''><b><font color=''#FFFFFF''></b> sulla fascia sinistra<br>ha <font color=''#0099FF''><b>Fritz HILMANN<font color=''#FFFFFF''></b> davanti a lui<br>lo dribbla con uno spettacolare gioco di gambe<br>cerca di trovare lo spazio giusto per tirare<br>dribbla un paio di avversari con un doppio passo<br>ma il pallone finisce ampiamente sopra la traversa.'),
(0, '2010-11-11', 17, 43, 'Bell''iniziativa di <font color=''#0099FF''><b>Abbondanzio GIACCAGLIA<font color=''#FFFFFF''></b> fascia sinistra<br><font color=''#0099FF''><b>Abbondanzio GIACCAGLIA<font color=''#FFFFFF''></b> arriva sul fondo e crossa al centro<br>il pallone arriva nella zona di <font color=''#0099FF''><b>Vicenz PORCEL<font color=''#FFFFFF''></b> e prova subito il tiro<br>i difensori di <font color=''#FF0000''><b>A.C STABIA<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola √® scattata! Fuorigioco netto!'),
(0, '2010-11-11', 15, 34, '<font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b> stoppa la palla in area di rigore<br>con uno sguardo controlla la posizione dei suoi compagni di squadra<br>prova un difficile passaggio filtrante per <font color=''#0099FF''><b>Vicenz PORCEL<font color=''#FFFFFF''></b><br>che stoppa la palla in buona posizione davanti alla porta<br>cerca di trovare lo spazio giusto per tirare<br>√® pressato, per√≤ riesce a mantenere il controllo del pallone<br>ma il pallone sfiora il palo e si spegne sul fondo!'),
(0, '2010-11-11', 14, 34, 'Calcio d''angolo per  <font color=''#0099FF''><b>11 pagliacci<font color=''#FFFFFF''></b><br>si incarica della battuta <font color=''#0099FF''><b>Abbondanzio GIACCAGLIA<font color=''#FFFFFF''></b><br>pallone calciato con molto effetto in mezzo all''area<br><font color=''#0099FF''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> stoppa la palla con il petto<br>ma il pallone finisce ampiamente sopra la traversa.'),
(0, '2010-11-11', 13, 34, '<font color=''#FF0000''><b><font color=''#FFFFFF''></b> interviene in ritardo ed invece che prendere il pallone colpisce in pieno la gamba dell''avversario.<br>L''arbitro corre verso <font color=''#FF0000''><b><font color=''#FFFFFF''></b> e lo ammonisce.<br><br>Calcio di punizione da circa 30 metri per <font color=''#0099FF''><b>11 pagliacci<font color=''#FFFFFF''></b><br>il braccio alzato dell''arbitro indica che √® di seconda<br><font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b> tocca il pallone per il compagno<br><font color=''#0099FF''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> prova a piazzare il pallone sul palo coperto dalla barriera<br>ma il pallone si perde sul fondo!'),
(0, '2010-11-11', 12, 32, 'Pallone stoppato magistralmente in area di rigore da <font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b><br>si √® guadagnato un piccolo spazio tra le maglie della difesa<br>prova il tiro<br>ma <font color=''#FF0000''><b>BILSEL<font color=''#FFFFFF''></b> con un riflesso incredibile riesce a respingere il pallone.'),
(0, '2010-11-11', 11, 32, '<font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b> conquista il pallone a centrocampo<br>triangolo con <font color=''#0099FF''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> che con un colpo di tacco smarcante restituisce palla a <font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b> in area di rigore<br>tiro di prima intenzione che si abbassa all''improvviso<br>√® incredibile cosa sia riuscito a sbagliare!'),
(0, '2010-11-11', 10, 30, '<font color=''#FF0000''><b><font color=''#FFFFFF''></b>  avanza con la palla a centrocampo.<br><font color=''#FF0000''><b><font color=''#FFFFFF''></b>  prova lo scambio con <font color=''#FF0000''><b>Galiazzo<font color=''#FFFFFF''></b>.<br><font color=''#FF0000''><b>Galiazzo<font color=''#FFFFFF''></b> riceve il pallone e lo stoppa con eleganza<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br><font color=''#0099FF''><b>Ruben MESANZA<font color=''#FFFFFF''></b> si allunga il pi√π possibile, ma riesce solo a sfiorare il pallone.<br>GOAL per <font color=''#FF0000''><b>A.C STABIA<font color=''#FFFFFF''></b>.'),
(0, '2010-11-11', 8, 19, 'Bell''iniziativa di <font color=''#0099FF''><b>Abbondanzio GIACCAGLIA<font color=''#FFFFFF''></b> sulla fascia sinistra<br>ha <font color=''#FF0000''><b><font color=''#FFFFFF''></b> davanti a lui<br>lo dribbla con uno spettacolare gioco di gambe<br>cerca di trovare lo spazio giusto per tirare<br>dribbla un paio di avversari con un doppio passo<br>ma la porta di <font color=''#FF0000''><b>BILSEL<font color=''#FFFFFF''></b> non corre nessun pericolo.'),
(0, '2010-11-11', 9, 25, 'Pallone conquistato in area di rigore da <font color=''#FF0000''><b><font color=''#FFFFFF''></b><br>evita il disperato intervento in scivolata del difensore centrale<br> calcia in porta di collo pieno, <br>ma √® pressato da <font color=''#0099FF''><b>Valentin LEIBIGER<font color=''#FFFFFF''></b> e perde il controllo del pallone.'),
