(0, '2010-11-11', 7, 15, 'Bel passaggio per <font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b> sulla fascia sinistra<br><font color=''#0099FF''><b>Dobiegniew GENDEK<font color=''#FFFFFF''></b> stoppa magistralmente il pallone ed avanza portandosi in buona posizione<br>dribbla due avversari e crossa al centro<br>ma <font color=''#FF0000''><b>BILSEL<font color=''#FFFFFF''></b> con un riflesso incredibile riesce a respingere il pallone.'),
(0, '2010-11-11', 5, 7, '<font color=''#0099FF''><b>Tuncay ULUSAN<font color=''#FFFFFF''></b> conquista il pallone a centrocampo<br>triangolo con <font color=''#0099FF''><b>Drew WIBBERLEY<font color=''#FFFFFF''></b> che con un colpo di tacco smarcante restituisce palla a <font color=''#0099FF''><b>Tuncay ULUSAN<font color=''#FFFFFF''></b> in area di rigore<br>tiro di prima intenzione che si abbassa all''improvviso<br>i difensori di <font color=''#FF0000''><b>A.C STABIA<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola √® scattata! Fuorigioco netto!');
