(1, '2010-11-11', 20, 82, 'Preciso lancio lungo a pescare in area avversaria <font color=''#0099FF''><b>Baldassarre Iannaccone<font color=''#FFFFFF''></b>.<br><font color=''#0099FF''><b>Baldassarre Iannaccone<font color=''#FFFFFF''></b> passa a <font color=''#0099FF''><b>Mutlu Nas<font color=''#FFFFFF''></b><br>che mette gi√π il pallone con un perfetto stop di petto<br>ha tutto il tempo di mirare e tirare da distanza ravvicinata<br>ma svirgola il pallone e l''azione sfuma.'),
(1, '2010-11-11', 19, 81, 'I difensori di <font color=''#FF0000''><b>Al.Sab. Calcio<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola √® scattata! Fuorigioco netto!'),
