(1, '2010-11-11', 16, 68, 'I difensori di <font color=''#FF0000''><b>Al.Sab. Calcio<font color=''#FFFFFF''></b> scattano in avanti cercando di mettere in fuorigioco gli avversari<br>e la trappola √® scattata! Fuorigioco netto!'),
